			"eduLogo": {
				"src": thesLogo,
				"cls": 'ed-company-logo ed-thes-logo'
			},
			"eduLocation": 'Aristotle University of Thessaloniki | Greece',
			"eduPeriod": '09/2008 – 06/2013',
			"eduModules": [
				'Algebra Advanced',
				'Statistics',
				'Operational Research',
				'Probabilities',
				'Fortran, SPSS, C++',
			],
		},
	]
};
